import React from "react";
import CartWidget from "../CartWidget";
const NavBar= () =>{
    return(
        <nav>
            <h1>React</h1>
            <ul>
                <li>Pastilleros</li>
                <li>LLaveros</li>
                <li>Lapizeros</li>
            </ul>
        <CartWidget/>
        </nav>
    )
}
export default NavBar;
